	function [R1n,R2n,R3n,R4n] = BOCTOR(R5n,R6n,C1n,C2n,won,wzn,Q)	%	%	%	%	%	%	%	sl@tek.sdu.dk	%		clear BOCTOR;	syms R1n R2n R3n R4n;	f1=won-sqrt(1/R4n/R6n/C1n/C2n);	f2=won/Q-1/R6n/C2n-(R2n+R4n)/R2n/R4n/C2n;	f3=wzn-sqrt((R1n+R2n*R4n/(R2n+R4n)+R6n)/R1n/(R2n*R4n/(R2n+R4n))/R6n/C1n/C2n);	f4=0-(1/R6n/C2n+(R2n+R4n)/R2n/R4n/C2n+1/R1n/C1n-R3n/R5n/R6n/C1n);	RES=solve(f1,f2,f3,f4);	R1n=vpa(RES.R1n,7);	R2n=vpa(RES.R2n,7);	R3n=vpa(RES.R3n,7);	R4n=vpa(RES.R4n,7);	